Music and gaming goes hand and hand. Metallica is my favorite band. I made this just for fun. I'm stoked for S&M2 in theaters in a few weeks!
🤘🤘
Wouldn't it be cool if someone took each song of an album, made a level based on the lyrics or theme and had the song playing while you went through the levels? 🎮
Anyways i hope you like it and if you do, I'll make a part 2 with the rest of their albums.
