La feria más importante de los videojuegos en territorio español está a una semana de su apertura de puertas. Allí podremos probar titulazos tan esperados como Final Fantasy VII Remake, Dragon Ball Z: Kakarot, Medievil, The last Of Us Part 2, Death Stranding... o incluso disfrutar de una presentacion de Cyberpunk con su doblaje al castellano. Todo ello y muchísimo más distribuido en más de 43.000 metros cuadrados. ¡Nosotros estaremos por allí y os mostraremos todo lo que podamos!
Y vosotros, ¿tenéis ya vuestra entrada? ¿Cuál es el juego al que más ganas le tenéis?

